import React from "react";

function ProjectInfo({image1, description1, image2, description2, image3, description3}){
    return(
        <div className="projectInfoContainer">
            <div id="detail1" className="detail">
                <img className="infoImg" src={image1}></img>
                <p>{description1}</p>
            </div>
            <div id="detail2" className="detail">
                <p>{description2}</p>
                <img className="infoImg" src={image2}></img>
                
            </div>
            <div id="detail3" className="detail">
                <img className="infoImg" src={image3}></img>
                <p>{description3}</p>
            </div>


        </div>
    );
    
}

export default ProjectInfo;
